INSERT INTO `rates` VALUES (36,NULL,NULL,'John Smith','Nasiyahan ako sa serbisyo na aking natanggap.','4','2025-02-13 05:33:10','2025-02-13 05:33:10',''),(37,NULL,NULL,'John Smith','Ang oras ng proseso ay mabilis.','5','2025-02-13 05:33:10','2025-02-13 05:33:10',''),(38,NULL,NULL,'John Smith','Ang opisina ay sumusunod sa mga kinakailangang dokumento at mga hakbang batay sa Citizen\'s Charter','3','2025-02-13 05:33:10','2025-02-13 05:33:10',''),(39,NULL,NULL,'John Smith','Mabilis at madali akong makanap ng impormasyon tungkol sa aking transaksyon mula sa opisina, website, at social media.','5','2025-02-13 05:33:10','2025-02-13 05:33:10',''),(40,NULL,NULL,'John Smith','Pakiramdam ko ay patas ang opisina sa lahat o walang \'palakasan\' sa aking transaksyon.','4','2025-02-13 05:33:10','2025-02-13 05:33:10',''),(41,NULL,NULL,'John Smith','Magalang, magiliw at labis na nakatulong ang empleyadong nakausap.','3','2025-02-13 05:33:10','2025-02-13 05:33:10',''),(42,NULL,NULL,'John Smith','Nakuha ko ang kinakailangan sa tanggapan, at kung di man nakuha ay naipaliwanag ito nang maayos.','4','2025-02-13 05:33:11','2025-02-13 05:33:11','');
